    def findRelationships(level = 0, parent, condition) {
        if(findRelationshipsTable[parent]){
            return
        }
        def childLevel = level + 1
        def childLevels = []
        findRelationshipsTable[parent] = true
        def where = condition
        if (startTable.equals(parent)) {
            where = "SELECT * FROM $parent "
            if(!condition.isEmpty()){
                where = "SELECT * FROM $parent $condition"
            }
        }
        relationships.findAll { it.PARENT == parent }.unique().each {
            def child = it.CHILD
            def parentId = it.PARENT_ID
            def childId = it.CHILD_ID
            def childConstraint = it.CHILD_CONSTRAINT
            def parentConstraint = it.PARENT_CONSTRAINT
            def deleteRule = it.DELETE_RULE
            //        reporterLogPrint "> $parent $child"
            it["WHERE"] = where
            it["PARENT_CONSTRAINT"] = parentConstraint
            it["CHILD_CONSTRAINT"] = childConstraint
            childLevels.add(it)
            def childWhere = "SELECT * FROM $child WHERE $childId IN (SELECT $parentId FROM ($where))"
            def c
            findRelationships(childLevel, child, childWhere)
            if(infoLevels[childLevel] == null){
                infoLevels[childLevel] = childLevels
            }else{
                infoLevels[childLevel] +=childLevels
            }
        }
        def a
    }

    def prepareRelationships(level = 1, parent = startTable, indent = " ") {
        if(prepareRelationshipsTable[parent]){
            return
        }
        def childLevel = level + 1
        def childLevels = []
        prepareRelationshipsTable[parent] = true
        //relationships.findAll{it.PARENT == "FTG_ARBSTALLE"  }
        def counter = 1
        relationships.findAll { it.PARENT == parent && it.CHILD != parent }.unique().each {
            def parentWhere = it["WHERE"]
            def child = it.CHILD
            def parentId = it.PARENT_ID
            def childId = it.CHILD_ID
            def childConstraint = it.CHILD_CONSTRAINT
            def parentConstraint = it.PARENT_CONSTRAINT
            def deleteRule = it.DELETE_RULE
            def relationship = "$indent --$level:${counter++} " + it.relation

            //def relationship = "$indent --$level:${counter++} $parent ($parentId)<$parentConstraint> << $child ($childId, $childConstraint) $deleteRule"
            relationshipsOrder += "$relationship\n"
//            relationshipsOrder += "$indent$parent ($parentId)<$parentConstraint> << $child ($childId, $childConstraint)\n"
            prepareRelationships(childLevel, child, "$indent ")

            def selectStatement = relationship + "${indent} SELECT * FROM $child WHERE $child.$childId IN (SELECT $parent.$parentId FROM ($parentWhere));"
            def deleteStatement = "${indent} DELETE $child WHERE $childId IN (SELECT $parentId FROM ($parentWhere)); -- $relationship"
            selectStatements.add(selectStatement)
            //if(deleteRule.equals("NO ACTION")) {
            deleteStatements.add(deleteStatement)
            childLevels.add(deleteStatement)
            // }
            if(deleteLevels[childLevel] == null){
                deleteLevels[childLevel] = childLevels
            }else{
                deleteLevels[childLevel] +=childLevels
            }

        }
        if (startTable.equals(parent)) {
            def relationship = "${indent} -- $parent\n"
            def selectStatement = relationship + "${indent}SELECT * FROM $parent $whereStatement;"
            def deleteStatements = relationship + "${indent}DELETE $parent $whereStatement;"
            selectStatements.add(selectStatement)
            this.deleteStatements += "$deleteStatements;\n"
            if(deleteLevels[0] == null){
                deleteLevels[0] = [deleteStatements]
            }else{
                deleteLevels[0] += deleteStatements
            }

        }

    }
